const terms = fetchSync.json(`https://caniuse.com/process/query.php?search=${input.trim()}`);

if (!terms.length) throw 'no results';

const results = fetchSync.json(`https://caniuse.com/process/get_feat_data.php?type=support-data&feat=${terms}`);

if (!results.length) throw 'no data';

const [result] = results;

const browsers = ['firefox', 'ie', 'edge', 'chrome', 'safari'];

function getVersion(browser) {
    const first =  Math.min(...Object.entries(result.stats[browser])
        .filter(([, is]) => is.includes('y'))
        .map(([version]) => version)
        .filter(d => !isNaN(d)));

    return `${browser}: ${first == Infinity ? '{r}X' : '{g}' + first}{/}`
}

print(`{dc}${result.keywords||''}{/} ${browsers.map(getVersion).join(' ')}`);
